import './App.css';
import {getAllCoupons, getCouponById, postCoupon, putCoupon, deleteCoupon} from './services/travelagentServices/couponService'


function App() {
  const fetchFestivals = async() => {
    try{
      const response = await putCoupon({
        "couponName": "sdf",
        "couponDescription": "sdv",
        "couponExpiration": "xcv",
        "couponDiscountPercentage": 10,
        "applicablePackageId": "adf"
      }, 'COUPID16109');
      console.log(response)
    }
    catch(error){
      console.log(error)
    }
  }
  return (
    <div className="App">
      <button onClick={fetchFestivals}>get</button>
    </div>
  );
}

export default App;
